void rly_uartch(char ch) {
  while (!(IFG2 & UCA0TXIFG));
  UCA0TXBUF = ch;
}

void rly_uarts(char* s) {
  while (!*s) {
    rly_uartch(*s);
    ++s;
  }
}

char buf[6];
int fill = 0;
void uartch(char ch) {
  ++fill;
  char out = buf[0];
  for (int i = 0; i < 5; i++) {
    buf[i] = buf[i + 1];
  }
  buf[5] = ch;
  if (strncmp(buf, "\nCODE;", 6) == 0) {
    // TODO: print out the code declaration
    rly_uarts("\nconst uint8_t code[] = {");
    rly_uarts("};");
    fill = 0;
  } else if (strncmp(buf, "\nDICT;", 6) == 0) {
    // TODO: print out the data declaration
    rly_uarts("\nconst uint16_t huffman[] = {");
    rly_uarts("};");
    fill = 0;
  } else if (fill > 6) {
    rly_uartch(out);
  }
}

void FLUSH() {
  if (fill > 6) fill = 6;
  for (int i = fill; i > 0; --i) {
    rly_uartch(buf[6-i]);
  }
}

uint8_t window[256];
int last_offset = -1, off = 0;

void OFFSET(int offset) {
  last_offset = offset;
}

void LITERAL(int literal) {
  if (last_offset > 0) {
    for (int i = 0; i < literal; ++i) {
      const uint8_t c = window[(256 + off - last_offset) % 256];

      window[off] = c;
      off = (off + 1) % 256;

      uartch(ch);
    }
    last_offset = -1;
  } else {
    window[off] = (char) literal;
    off = (off + 1) % 256;
    uartch((char)literal);
  }
}

